		path.addCurve(to: CGPoint(x: 0.13457*width, y: 0.6627*height), control1: CGPoint(x: 0.07471*width, y: 0.66133*height), control2: CGPoint(x: 0.11395*width, y: 0.65919*height))
		path.closeSubpath()
		return path
	}
}
